import React from "react";
import styles from "./Welcome.module.css";
import NavBar from "../navBar/NavBar";
import 'font-awesome/css/font-awesome.min.css'; 

const Welcome = () => {
    return(
        <div className={styles.container}>
            <NavBar />
            <div className={styles.container__display}>
                <h1 className={styles.display__name}>Roel A. Montoya</h1>
                <div className={styles.display__quote}>Whatever Your Mind Can Conceive and Believe, It Can Achieve.</div>
                <div className={styles.display__logos}>
                    <a target="_blank" href="#">
                        <i className="fa-brands fa-github fa-3x socialicons"></i>
                    </a>
                </div>
                <a className={styles.display__resume}>My Resume</a>
            </div>
        </div>
    );
};

export default Welcome;
